import React from "react";


const ClearOutput = () => {
    const Email = document.getElementById('email-address');
    const Password = document.getElementById('password');

    if (!(Email === "") || !(Password === "")) {
        Email.value = "";
        Password.value = "";
    }


};

const LoginBtn = () => {

};

const Login = () => {
    return (
        <>
            <main className="pa6 black-80 vh-100 w-100">
                <form className="measure center">
                    <fieldset id="sign_up" className="ba b--transparent ph0 mh0">
                        <legend className="tc f1 fw6 ph0 mh0">Student Log In</legend>
                        <div className="mt3">
                            <label className="db fw6 lh-copy f6" htmlForfor="email-address">Email</label>
                            <input className="pa2 input-reset ba bg-transparent hover-bg-black hover-white w-100" type="email" name="email-address" id="email-address" />
                        </div>
                        <div className="mv3">
                            <label className="db fw6 lh-copy f6" for="password">Password</label>
                            <input className="b pa2 input-reset ba bg-transparent hover-bg-black hover-white w-100" type="password" name="password" id="password" />
                        </div>
                    </fieldset>
                    <div className="">
                        <input className="f6 grow no-underline br-pill ba bw1 ph3 pv2 mb2 dib dark-blue" type="submit" value="Log In" onClick={LoginBtn} />
                        <input className="f6 grow no-underline br-pill ba bw1 ph3 pv2 mb2 dib dark-blue" type="reset" value="Clear" onClick={ClearOutput} />
                    </div>
                    <div className="lh-copy mt3">
                        <a href="#0" className="f6 link dim black db">Forgot your password?</a>
                    </div>
                </form>
            </main>

            <footer class="pt4 mt3 pb0 ph3 ph5-m ph6-l bg-light-gray">
                <small class="f6 db tc">Â©<b class="ttu">Created by Group CB</b>., All Rights Reserved</small>
            </footer>



        </>

    );

}

export default Login;
